	private void buildMsgMap(int cmdType, int cmdId, Class<? extends GeneratedMessageLite> clazz){
		String key = buildKey(cmdType, cmdId);
		if(idToMsgMap.containsKey(key)){
			LogCore.startup.error("[消息解析器] 消息重复 type = {}, cmd = {}, {}", cmdType, cmdId, clazz);
			return ;
		}
		this.idToMsgMap.put(key, clazz);
	}
	
	
	private String buildKey(int cmdType, int cmdId){
		return cmdType + Cat.colon + cmdId;
	}
	
	
	private int[] parseKey(String key){
		String[] strCmds = key.split(Cat.colon);
		int[] cmds = {Integer.parseInt(strCmds[0]), Integer.parseInt(strCmds[1])};
		return cmds;
	}
	
	
	@Override
	public int[] clazzToId(Class<? extends MessageLite> clazz) {
		String key = this.msgToIdMap.get(clazz);
		if(key == null){
			throw new NullPointerException(clazz.getName() + " 此消息没有注册....");
		}
		return this.parseKey(key);
	}
	
	
	

